import React, {Component} from 'react';

class Stations extends Component {
  render(){
    return(
      <div>
        <h2>Nome: {this.props.nome}</h2>
        <h2>Cargo: {this.props.cargo}</h2>
      </div>
    )
  }
}

class App extends Component {

  constructor(props){
    super();
    this.state = {
      nome: ''
    }
  }
  render(){
    return(
      <div class='container'>
        <Stations nome="Juan" cargo="dev"/>
      </div>
    )
  }
}
export default App;
